CREATE TABLE Airline_Dataset(
   "Passenger ID"         INTEGER  NOT NULL PRIMARY KEY 
  ,"First Name"           VARCHAR(15) NOT NULL
  ,"Last Name"            VARCHAR(25) NOT NULL
  ,Gender                 VARCHAR(6) NOT NULL
  ,Age                    INTEGER  NOT NULL
  ,Nationality            VARCHAR(44) NOT NULL
  ,"Airport Name"         VARCHAR(65) NOT NULL
  ,"Airport Country Code" VARCHAR(2) NOT NULL
  ,"Country Name"         VARCHAR(44) NOT NULL
  ,"Airport Continent"    VARCHAR(3) NOT NULL
  ,Continents             VARCHAR(13) NOT NULL
  ,"Departure Date"       DATE  NOT NULL
  ,"Arrival Airport"      VARCHAR(3) NOT NULL
  ,"Pilot Name"           VARCHAR(30) NOT NULL
  ,"Flight Status"        VARCHAR(9) NOT NULL
);
